import React from 'react'

import classes from './todoList.module.css'

function TodoList() {
    return (
        <ul className={classes.todoList}>
            <li>
                Doing some thing
                <i class="fas fa-trash"></i>
            </li>  
        </ul>
    )
}

export default TodoList
